description:
Keisha's boyfriend needed to get his girl away from himself because she was being too clingy. Johnny decided to hire her to be his assistant to help out his friend, but to also help out himself. Johnny tells Keisha about her boyfriend's real intentions and that her other purpose was to give him a hand relieving his stress.

